import React from 'react';
import Completed from '../../assets/images/completed.svg';
import Current from '../../assets/images/current-level.svg';
import Locked from '../../assets/images/locked.svg';

function LevelItem({ level, currentLevel }) {
    const isCompleted = level < currentLevel; // Check if level is completed
    const isCurrent = level === currentLevel; // Check if level is current
  
    const classes = `level-path-btn mx-2 ${
      isCompleted ? 'completed' : isCurrent ? 'current ring-4 ring-offset-4 ring-gray-400' : 'locked'
    }`;
  
    return (
      <li className="mt-5">
        <a href='/Game' className={classes}>
          <img src={isCompleted ? Completed : isCurrent ? Current : Locked} className='size-14 '/>
        </a>
      </li>
    );
}
  

export default LevelItem;
